import React from 'react';
import './Home.css';

function HomePage() {
  return (
    <div className="home">
      <div className="home-header">
        <h1>Welcome to DevsOnDeck</h1>
        <p>Your platform for connecting developers and job opportunities.</p>
      </div>

      <div className="home-actions">
        <button className="home-button">For Developers</button>
        <button className="home-button">For Organizations</button>
      </div>

      {/* Image insérée après la section des actions */}
      <div className="home-image">
        <img 
          src="https://images.unsplash.com/photo-1556742031-c6961e8560b4" 
          alt="Developers working together" 
        />
      </div>
    </div>
  );
}

export default HomePage;
